// Sidebar.js
import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTachometerAlt, faUser, faBroadcastTower, faBell, faChartBar } from '@fortawesome/free-solid-svg-icons';

const Sidebar = () => {
    return (
      <aside className="w-64 bg-white min-h-screen">
        <div className="flex items-center justify-center pt-6">
          {/* Your logo here */}
        </div>
        <nav className="mt-8">
          <a href="#" className="flex items-center p-2 text-gray-600 hover:text-gray-900 hover:bg-gray-100 rounded-md">
            <FontAwesomeIcon icon={faTachometerAlt} className="h-6 w-6 mr-3" />
            Dashboard
          </a>
          <a href="#" className="flex items-center p-2 text-gray-600 hover:text-gray-900 hover:bg-gray-100 rounded-md">
            <FontAwesomeIcon icon={faUser} className="h-6 w-6 mr-3" />
            Profile
          </a>
          <a href="#" className="flex items-center p-2 text-gray-600 hover:text-gray-900 hover:bg-gray-100 rounded-md">
            <FontAwesomeIcon icon={faBroadcastTower} className="h-6 w-6 mr-3" />
            Go Live
          </a>
          <a href="#" className="flex items-center p-2 text-gray-600 hover:text-gray-900 hover:bg-gray-100 rounded-md">
            <FontAwesomeIcon icon={faBell} className="h-6 w-6 mr-3" />
            Notification
          </a>
          <a href="#" className="flex items-center p-2 text-gray-600 hover:text-gray-900 hover:bg-gray-100 rounded-md">
            <FontAwesomeIcon icon={faChartBar} className="h-6 w-6 mr-3" />
            Statistics
          </a>
        </nav>
      </aside>
    );
  };
  
  export default Sidebar;
